import React from "react";

import { useDispatch, useSelector } from "react-redux";
import {useForm} from 'react-hook-form';
import { yupResolver } from '@hookform/resolvers/yup';
import * as yup from 'yup';
import { createMovie } from "../redux/action-creators";
import { Container,Row,Col25,InputFormTxt,LabelForm,InputFormSub, TextareaForm } from "../components/styled/Form.style";
import Home from "./Home";


const CreateMovie = () => {

  const dispatch = useDispatch();

  const { createMovieData, error  } = useSelector((state) => state.createMoviesReducer);

  const schema = yup.object().shape({
    title: yup.string().required(),
    year: yup.number().min(1000).max(9999).typeError("Must be a number"),
    rating: yup.number().min(1).max(10).typeError("Must be a number"),
    description: yup.string().required()
  })

  const {
    register,
    handleSubmit,
    formState: { errors },
    reset,
  } = useForm({ resolver: yupResolver(schema) });

  const onSubmit = (d) =>{
    // console.log(d);

     dispatch(createMovie(d));
     reset();

  }





  return (
    <div className="mycard">

<Container>
  <form>
  <Row>
      <Col25>
        <LabelForm >Title</LabelForm>
      </Col25>
      <Col25>
        <InputFormTxt/>
      </Col25>
    </Row>
    <Row>
      <Col25>
        <LabelForm >Year</LabelForm>
      </Col25>
      <Col25>
        <InputFormTxt/>
      </Col25>
    </Row>
    <Row>
      <Col25>
        <LabelForm >Rating</LabelForm>
      </Col25>
      <Col25>
        <InputFormTxt/>
      </Col25>
    </Row>
    <Row>
      <Col25>
        <LabelForm >Description</LabelForm>
      </Col25>
      <Col25>
        <TextareaForm></TextareaForm>
      </Col25>
    </Row>
    <Row>
      <InputFormSub/>
    </Row>
  </form>
</Container>

      <div className="card auth-card input-field">

      <form onSubmit={handleSubmit(onSubmit)}>
          <label> Title
        <input
         {...register("title")}
        />
        <p>{errors.title?.message}</p>
        {console.log("CREATE ERROS",createMovieData)}
        {createMovieData && createMovieData.movieMessageExists &&
           <p> 
             {createMovieData.movieMessageExists}
           </p>

            }  

        </label>
        <label> Year
        <input
        {...register("year")}
        />
         <p>{errors.year?.message}</p>
         </label>
         <label> Rating
         <input
          {...register("rating")}
        />
        {createMovieData && createMovieData.messageRest &&
           <p> 
             {createMovieData.messageRest}
           </p>
        }   
           <p>{errors.rating?.message}</p>
           </label>
           <label> Description
           <textarea
          {...register("description")}
        />
           <p>{errors.description?.message}</p>
           </label>
        {error !== null ? <div className="error">{error}</div> : null}
        <input
          className="btn waves-effect waves-light #42a5f5 blue lighten-1"
          type='submit'
          value='Create Movie'
        />
        </form>
      </div>
      <Home/>

    </div>
  );
};

export default CreateMovie;
